import React from 'react'
import { footeritems1, footeritems2 , footeritems3 } from './footerlinks'

const Footer = () => {

 
    return (
        <div className='bg-black  mt-1 h-full'>
            <div className='mx-10 p-10 '>
                <p className='text-white px-56 text-xl'>Questions? Call 000-800-919-1694</p>
            </div>

            <div className='  flex justify-evenly text-white' >
                
                <div className=' flex flex-col' >
                    {
                        footeritems1.map(({ id, link, href }) => {
                            return <>
                                <ul >
                                    <li className='py-2'>{link}</li>
                                </ul>
                            </>

                        })
                    }

                </div>
                
                <div className='   flex flex-col' >
                    {
                        footeritems2.map(({ id, link, href }) => {
                            return <>
                                <ul >
                                    <li className='py-2'>{link}</li>
                                </ul>
                            </>

                        })
                    }

                </div>
                <div className='   flex flex-col' >
                    {
                        footeritems3.map(({ id, link, href }) => {
                            return <>
                                <ul >
                                    <li className='py-2'>{link}</li>
                                </ul>
                            </>

                        })
                    }

                </div>

                
            </div>

            <div>

            </div>
        </div>
    )
}

export default Footer
